export default () => {
  const excludeStoreColdef = [{
      Header: "Store ID",
      accessor: "store_id",
    },
    {
      Header: "Store Description",
      accessor: "store_desc"
    },
    {
      Header: "Sell Through %",
      columns: [{
          Header: "LY",
          accessor: "sellLy",
        },
        {
          Header: "TY",
          accessor: "sellTy",
        },
      ],
    },
    {
      Header: "Margin %",
      columns: [{
          Header: "LY",
          accessor: "marginLy",
        },
        {
          Header: "TY",
          accessor: "marginTy",
        },
      ],
    },
    {
      Header: "Inventory On Hand",
      accessor: "inv_onhand",
    },
    {
      Header: "Actual Sales",
      accessor: "actual_sales",
    },
    {
      Header: "Model Predicted Sales",
      accessor: "modelPredictedSales",
    },

    {
      Header: "Sales Contribution %",
      accessor: "salesContribution",
    },
  ];
  return excludeStoreColdef;
};
